import React, { Component } from "react";

class Main extends Component {
  state = {
    movies: [],
  };

  componentDidMount() {
    fetch("http://www.omdbapi.com/?i=tt3896198&apikey=9a960700&s=black")
    .then(response => response.json())
    .then(data => this.setState({ movies: data.Search }));
  }
  render() {
    return ;
  }
}

export default Main;
